import React from 'react';
import Link from 'next/link';
import './header.css';

const logopic = require('./logo.png')

const Header = ({ }) =>
    <div id="header">
        <Link href="/HomePage">
        <div id="headerlogo">
            <img id="logoimg" src={logopic} />
        </div>
        </Link>
    </div>;

// Home.defaultProps = {

// }

export default Header;
